            if (level == SecureParameter.LEVEL_NULL_OR_EMPTY_STRING) {
                return "<not empty string>";
            }

            return "'" + parameter + "'";
        }

        if (level != SecureParameter.LEVEL_FULL_INFO) {
            return "<not null value>";
