        while (p < length) {
            n = scan(header, p, ',');

            String token;
            if (charAtIs(header, n, ',')) {
                token = header.substring(p, n);
            } else {
                token = header.substring(p);
                n = length;
            }

            tokens.add(itemFactory.createItem(token));

            p = n + 1;
        }

        if (tokens.size() > 1) {
            Collections.sort(tokens, QUALITY_VALUE_COMPARATOR);
