public static int compare(byte[] a, byte[] b) {
        int aLength = a.length;
        int bLength = b.length;

        for (int i = a.length - 1; i >= 0 && a[i] == 0; i--) {
            aLength--;
        }

        for (int i = b.length - 1; i >= 0 && b[i] == 0; i--) {
            bLength--;
        }

        if (aLength > bLength) {
            return 1;
        } else if (bLength > aLength) {
            return -1;
        }

        for (int k = 0; k < aLength; k++) {
            int A = a[k] & 0xff;
            int B = b[k] & 0xff;
            if (A > B) {
                return 1;
            }
            if (A < B) {
                return -1;
            }
        }
        return 0;
    }
