			if (Character.isWhitespace(c)) {
				indentSb.append(c);
				lastOriginWhitespacePos = i + 1;
			} else {
				indentSb.append(" ");
			}
		}
		if (lastOriginWhitespacePos == -1) {
			return ""; // there were no origin whitespaces so do not indent
		}
		String indent = indentSb.substring(0, lastOriginWhitespacePos);
		return indent;
	}
